import Item from "./Item";
function Expences(props) {
  return (
    <div className="expences">
      <Item
        date={props.item[0].item_date}
        name={props.item[0].item_name}
        price={props.item[0].item_price}
      ></Item>
      <Item
        date={props.item[1].item_date}
        name={props.item[1].item_name}
        price={props.item[1].item_price}
      ></Item>
      <Item
        date={props.item[2].item_date}
        name={props.item[2].item_name}
        price={props.item[2].item_price}
      ></Item>
      <Item
        date={props.item[3].item_date}
        name={props.item[3].item_name}
        price={props.item[3].item_price}
      ></Item>
    </div>
  );
}
export default Expences;
